import './login.css'
function Transition(){
    return(
        <div class="login">
            <h1>Transition Pin</h1>

            <input type="textbox" placeholder="******" />

            <a><button class="sumbit">Continue</button></a>
            <p>Didn't got transition pin? <a href="">Resend</a> </p>
        </div>
    )
}
export default Transition;
